import { Component, EventEmitter, Output } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

export type Record = {
  empId: number;
  empName: string;
}

@Component({
  selector: 'app-new-record',
  standalone: true,
  imports: [CommonModule, FormsModule],
  templateUrl: './new-record.component.html',
  styleUrls: ['./new-record.component.css']
})
export class NewRecordComponent {
  id!: number;
  name = '';
  alert = false;
  alertStatus = "";

  @Output() entry = new EventEmitter<Record>();
  onSubmit() {
    if(this.id == undefined || this.name == undefined) {
      console.log("Id: "+this.id+"\n Name: "+this.name)
      this.alert = true;
      if(this.id == undefined)
        this.alertStatus = "Emp Id cannot be empty.";
      if(this.name == undefined)
        this.alertStatus = "Emp Name cannot be empty.";
    } else {
      this.entry.emit({empId: this.id, empName: this.name});
    }
  }

  @Output() close = new EventEmitter<void>();
  onCancel() {
    this.close.emit();
  }
}
